<!DOCTYPE html>
<html lang="en">

<head>
  <meta charset="UTF-8" />
  <style>
    @page {
      size: 150.87px 70.08px;
      margin: 0;
    }

    * {
      margin: 0;
      padding: 0;
      box-sizing: border-box;
    }

    body {
      background-color: #f9f9f9;
      display: flex;
      justify-content: center;
      align-items: center;
      margin: 0;
    }

    .label-card {
      background-color: #fff;
      border-radius: 5px;
      text-align: left;
      font-size: 15px;
      width: 100%;
    }

    .brand {
      margin-top: 3px;
      display: flex;
      justify-content: space-between;
      height: 4mm;
    }

    .brand h2 {
      font-size: 15px;
      color: #000;
    }

    .brand p {
      color: black;
      font-size: 5px;
      line-height: 5px;
      font-family: Arial;
      font-weight: bold;
    }

    .product-info {
      padding: 0;
      max-height: 23.5mm;
      min-height: 25px;
      overflow: hidden;
    }

    .product-info p {
      font-size: 6px;
      white-space: nowrap;
      line-height: 7px;
      font-family: Arial;
      font-weight: bold;
      margin-left: 7px;
    }

    .up {
      align-items: center;
      display: flex;
    }

    .icons span {
      font-size: 18px;
      font-weight: bold;
    }

    .down .barcode {
      width: 100%;
      height: 10px;
    }

    .product-info .trash {
      width: 50px;
    }

    .icons {
      float: right;
      right: 0;
      position: absolute;
    }

    .icons img {
      width: 50px;
      height: 20px;
    }

    .symb {
      font-size: 15px;
      line-height: 0;
    }

    .amp {
      display: flex;
      align-items: center;
    }

    .brand {
      overflow: hidden;
      display: flex;
      align-items: center;
    }

    .brand .brand_img {
      width: 40px;
      height: 9px;
      margin-left: 7px;
    }

    .down {
      font-size: 6px;
      overflow: hidden;
      line-height: 7px;
      font-weight: bold;
      font-family: Arial;
      margin-left: 7px;
      margin-right: 5px;
    }

    .country {
      display: flex;
      justify-content: space-between;
    }
  </style>
</head>
